CKEDITOR.plugins.setLang("a11yhelp","es",{title:"Instrucciones de accesibilidad",contents:"Ayuda. Para cerrar presione ESC.",legend:[{name:"General",items:[{name:"Barra de herramientas del editor",legend:'Presiona ${toolbarFocus} para navegar por la barra de herramientas. Para moverse por los distintos grupos de herramientas usa las teclas TAB y MAY+TAB. Para moverse por las distintas herramientas usa FLECHA DERECHA o FECHA IZQUIERDA. Presiona "espacio" o "intro" para activar la herramienta.'},{name:"Editor de di\xe1logo",legend:"Dentro del di\xe1logo, presione TAB para navegar a los siguientes elementos de di\xe1logo, presione SHIFT+TAB para moverse a los anteriores elementos de di\xe1logo, presione ENTER para enviar el di\xe1logo, presiona ESC para cancelar el di\xe1logo. Cuando el di\xe1logo tiene multiples pesta\xf1as, la lista de pesta\xf1as puede ser abarcada con ALT + F10 or con TAB como parte del orden de pesta\xf1as del di\xe1logo. ECon la pesta\xf1a enfocada, puede moverse a la siguiente o anterior pesta\xf1a con las FLECHAS IZQUIRDA y DERECHA respectivamente."},{name:"Editor del men\xfa contextual",legend:"Presiona ${contextMenu} o TECLA MEN\xda para abrir el men\xfa contextual. Entonces mu\xe9vete a la siguiente opci\xf3n del men\xfa con TAB o FLECHA ABAJO. Mu\xe9vete a la opci\xf3n previa con SHIFT + TAB o FLECHA ARRIBA. Presiona ESPACIO o ENTER para seleccionar la opci\xf3n del men\xfa. Abre el submen\xfa de la opci\xf3n actual con ESPACIO o ENTER o FLECHA DERECHA. Regresa al elemento padre del men\xfa con ESC o FLECHA IZQUIERDA. Cierra el men\xfa contextual con ESC."},{name:"Lista del Editor",legend:"Dentro de una lista, te mueves al siguiente elemento de la lista con TAB o FLECHA ABAJO. Te mueves al elemento previo de la lista con SHIFT+TAB o FLECHA ARRIBA. Presiona ESPACIO o ENTER para elegir la opci\xf3n de la lista. Presiona ESC para cerrar la lista."},{name:"Barra de Ruta del Elemento en el Editor",legend:"Presiona ${elementsPathFocus} para navegar a los elementos de la barra de ruta. Te mueves al siguiente elemento bot\xf3n con TAB o FLECHA DERECHA. Te mueves al bot\xf3n previo con SHIFT+TAB o FLECHA IZQUIERDA. Presiona ESPACIO o ENTER para seleccionar el elemento en el editor."}]},{name:"Comandos",items:[{name:"Comando deshacer",legend:"Presiona ${undo}"},{name:"Comando rehacer",legend:"Presiona ${redo}"},{name:"Comando negrita",legend:"Presiona ${bold}"},{name:"Comando it\xe1lica",legend:"Presiona ${italic}"},{name:"Comando subrayar",legend:"Presiona ${underline}"},{name:"Comando liga",legend:"Presiona ${liga}"},{name:"Comando colapsar barra de herramientas",legend:"Presiona ${toolbarCollapse}"},{name:"Comando accesar el anterior espacio de foco",legend:"Presiona ${accessPreviousSpace} para accesar el espacio de foco no disponible m\xe1s cercano anterior al cursor, por ejemplo: dos elementos HR adyacentes. Repite la combinaci\xf3n de teclas para alcanzar espacios de foco distantes."},{name:"Comando accesar el siguiente spacio de foco",legend:"Presiona ${accessNextSpace} para accesar el espacio de foco no disponible m\xe1s cercano despu\xe9s del cursor, por ejemplo: dos elementos HR adyacentes. Repite la combinaci\xf3n de teclas para alcanzar espacios de foco distantes."},{name:"Ayuda de Accesibilidad",legend:"Presiona ${a11yHelp}"},{name:" Paste as plain text",legend:"Press ${pastetext}",legendEdge:"Press ${pastetext}, followed by ${paste}"}]}],tab:"Tabulador",pause:"Pausa",capslock:"Bloq. May\xfas.",escape:"Escape",pageUp:"Regresar P\xe1gina",pageDown:"Avanzar P\xe1gina",leftArrow:"Flecha Izquierda",upArrow:"Flecha Arriba",rightArrow:"Flecha Derecha",downArrow:"Flecha Abajo",insert:"Insertar",leftWindowKey:"Tecla Windows Izquierda",rightWindowKey:"Tecla Windows Derecha",selectKey:"Tecla de Selecci\xf3n",numpad0:"Tecla 0 del teclado num\xe9rico",numpad1:"Tecla 1 del teclado num\xe9rico",numpad2:"Tecla 2 del teclado num\xe9rico",numpad3:"Tecla 3 del teclado num\xe9rico",numpad4:"Tecla 4 del teclado num\xe9rico",numpad5:"Tecla 5 del teclado num\xe9rico",numpad6:"Tecla 6 del teclado num\xe9rico",numpad7:"Tecla 7 del teclado num\xe9rico",numpad8:"Tecla 8 del teclado num\xe9rico",numpad9:"Tecla 9 del teclado num\xe9rico",multiply:"Multiplicar",add:"Sumar",subtract:"Restar",decimalPoint:"Punto Decimal",divide:"Dividir",f1:"F1",f2:"F2",f3:"F3",f4:"F4",f5:"F5",f6:"F6",f7:"F7",f8:"F8",f9:"F9",f10:"F10",f11:"F11",f12:"F12",numLock:"Num Lock",scrollLock:"Scroll Lock",semiColon:"Punto y coma",equalSign:"Signo de Igual",comma:"Coma",dash:"Gui\xf3n",period:"Punto",forwardSlash:"Diagonal",graveAccent:"Acento Grave",openBracket:"Abrir llave",backSlash:"Diagonal Invertida",closeBracket:"Cerrar llave",singleQuote:"Comillas simples"});